import './App.css';
import Navbar from './Navbar';
import GuestForm from './GuestForm';

function App() {

  return (
    <div className="App">
      <Navbar />
      <div className="App-main container-fluid bg-danger">
        <div className="App-header row justify-contents-center py-2 bg-primary">
          <h1>Your Artist Tracker!</h1>
        </div>
        <div className="row mb-3 p-3 align-items-center justify-content-center border border-success">
          <div className="col-8 justify-content-center">

              <GuestForm />

          </div>
          <div className="col-4 justify-content-center">
            <div className="App-right border border-danger">
              <p>Create an account to save your favorite artists! Every time you log in, you'll see
                a list of their shows near you!
              </p>
            </div>
          </div>
        </div>


      </div>
    </div>
  );
}

export default App;
